raiz.title("Generador de certificados")

def abrirArchivo():
    desktop = os.path.join(os.path.join(os.environ['USERPROFILE']), 'Desktop')
    archivo = filedialog.askopenfilename(title = "Seleccionar excel con nombres")
    plantilla = filedialog.askopenfilename(title = "Seleccionar plantilla de certificado")
    pdf = PDF('L','mm', 'A4')

    datos = pd.read_excel(archivo, "Hoja1", index_col = 0, engine ='openpyxl')

    print("Datos recibidos")
    #print(datos.index)
    count = 0
    for i in datos.index:
        pdf.add_page()
        pdf.contenido(i, plantilla, count)
        count+=1
    archivofinal = desktop + "\certificados.pdf"
    messagebox.showinfo("Reporte de creacion",f'Certificados generados: {count}\nRuta del archivo generado: {archivofinal}')
    pdf.output(archivofinal)

