class PDF(FPDF):
    def contenido(self, nombre, plantilla, count):
        self.image(plantilla,0,0,297,210)
        self.set_font('Arial', 'B', 20) #Selecciona tipografia y tamano
        self.ln(0)
        self.set_left_margin(0.0)
        self.set_xy(0.0,0.0)
        xMid = 75
        yMid = 90
        if xCord.get() != "" and yCord.get() != "":
            x = float(xCord.get())
            y = float(yCord.get())
        elif xCord.get() != "" and yCord.get() == "":
            x = float(xCord.get())
            y = yMid
        elif yCord.get() != "" and xCord.get() == "":
            x = xMid
            y = float(yCord.get())
        else:
            x = xMid
            y = yMid
        self.set_xy(x,y)
        self.cell(150,10, nombre, border=0, ln=1, align='C')
        if count == 0: print(f'Se posiciono en x: {x} y: {y}')
        
raiz.mainloop()

